    public int maxDistance(int[][] grid) {
        int m = grid.length;
        int n = grid[0].length;
        int max = -1;
        LinkedList<int[]> queue = new LinkedList<>();
        boolean[][] visited = new boolean[m][n];
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (grid[i][j] == 1) {
                    queue.add(new int[]{i, j, 0});
                    visited[i][j] = true;
                }
            }
        }
        while (!queue.isEmpty()) {
            int size = queue.size();
            while (size-- > 0) {

                int[] cell = queue.poll();
                int x = cell[0];
                int y = cell[1];

                max = Math.max(max, grid[x][y] - 1);

                for (int[] dir : directions) {
                    int nx = dir[0] + x;
                    int ny = dir[1] + y;

                    if (nx < 0 || ny < 0 || nx >= grid
                            .length || ny >= grid[0].length || visited[nx][ny] || grid[nx][ny] == 1) {
                        continue;
                    }

                    int[] nele = {nx, ny, cell[2] + 1};
                    grid[nx][ny] = grid[x][y] + 1;
                    queue.add(nele);
                    visited[nx][ny] = true;
                }
            }
        }

        return max == 0 ? -1 : max;
    }
